import styled from "styled-components";

const Nav = styled.nav``;

const Col = styled.div``;

function Header() {
  return (
    <Nav>
      <Col>
        <Logo />
        <Itemts>
          <Item>Home</Item>
          <Item>Tv Shows</Item>
        </Itemts>
      </Col>
      <Col>
        <button>Search</button>
      </Col>
    </Nav>
  );
}

export default Header;
